import { En_Hero } from "../comps/Portal";

const Charging = () => {
  return (
    <>
      <En_Hero
        prod={megapack}
        title="Megapack"
        subtitle="Massive Energy Storage"
        get={megapack.getLink}
      />
    </>
  );
};

export default Charging;
